import React from 'react';

const Spinner = () => {
	return (
		<div className='ui '>
			<div className='ui active dimmer'>
				<div className='ui text loader'>
					Please allow the location to use this service!
				</div>
			</div>
			<p></p>
		</div>
	);

	Spinner.defaultProps = {
		message: 'Loading...',
	};
};

export default Spinner;
